/* Procedure structure for procedure `addBankCard` */

/*!50003 DROP PROCEDURE IF EXISTS  `addBankCard` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `addBankCard`(userIdx int(11),accountx VARCHAR(30),namex VARCHAR(30),bankTypex INT(2))
BEGIN
	INSERT INTO bankbindlist(userId,account,name,bankType) VALUES(userIdx,accountx,namex,bankTypex);
	SELECT LAST_INSERT_ID() as rcode;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `AddGold` */

/*!50003 DROP PROCEDURE IF EXISTS  `AddGold` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `AddGold`(userIdx INT (11),goldx Int (11),change_typex int(2))
BEGIN
	DECLARE scorex INT DEFAULT -1;
	SELECT score INTO scorex FROM userinfo_imp WHERE userId = useridx;
	IF scorex = -1 THEN
		SELECT 0 AS rcode;
	ELSE
		UPDATE userinfo_imp SET score=score+goldx WHERE userId = userIdx;
		INSERT INTO score_changelog(userid,score_before,score_change,score_current,change_type,isOnline) VALUES(userIdx,scorex,goldx,scorex + goldx,change_typex,0);
		SELECT 1 AS rcode;
	END IF;
   END */$$
DELIMITER ;

/* Procedure structure for procedure `AddGoldSub` */

/*!50003 DROP PROCEDURE IF EXISTS  `AddGoldSub` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `AddGoldSub`(userIdx INT (11),goldx INT (11),change_typex INT(2))
BEGIN
	DECLARE scorex INT DEFAULT -1;
	SELECT score INTO scorex FROM userinfo_imp WHERE userId = useridx;
	IF scorex = -1 or scorex < (goldx * -1) THEN
		SELECT 0 AS rcode;
	ELSE
		UPDATE userinfo_imp SET score=score+goldx WHERE userId = userIdx;
		INSERT INTO score_changelog(userid,score_before,score_change,score_current,change_type,isOnline) VALUES(userIdx,scorex,goldx,scorex + goldx,change_typex,0);
		SELECT 1 AS rcode;
	END IF;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `addPrize` */

/*!50003 DROP PROCEDURE IF EXISTS  `addPrize` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `addPrize`(roomTypex INT(3),matchIdx int(20))
BEGIN
	SELECT gameaccount.msg.*,fish.`matchrandking`.`rankIdx` FROM gameaccount.msg LEFT JOIN fish.`matchrandking` ON msg.`matchlogId` = fish.`matchrandking`.`id` WHERE fish.matchrandking.roomType=roomTypex AND fish.matchrandking.matchId=matchIdx AND msg.isGetPrize=0;
END */$$
DELIMITER ;

/* Procedure structure for procedure `changeOfficial` */

/*!50003 DROP PROCEDURE IF EXISTS  `changeOfficial` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `changeOfficial`(userIdx INT(11),newAccountx VARCHAR(30), passwordx VARCHAR(32),px VARCHAR(30))
BEGIN
	set @name = "";
	set @count = 0;
	SELECT count(*) INTO @count FROM newuseraccounts WHERE Account = newAccountx;
	if @count > 0 then
		SELECT 0 AS rcode;
	else
		update newuseraccounts set Account = newAccountx,Password = passwordx,p = px,official=1 where Id = userIdx;
		SELECT 1 AS rcode;
	end if;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `checkPhone` */

/*!50003 DROP PROCEDURE IF EXISTS  `checkPhone` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `checkPhone`(idx INT(11),phoneNox VARCHAR(11))
BEGIN
	SET @flag = 0;
	SET @phone = "";
	SELECT COUNT(*) INTO @flag FROM newuseraccounts WHERE phoneNo = phoneNox;
	select phoneNo INTO @phone FROM newuseraccounts WHERE Id = idx;
	if @flag = 1 or @phone != "" then
		select 0 as rcode;
	else
		select 1 AS rcode;
	end if;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `copyhand` */

/*!50003 DROP PROCEDURE IF EXISTS  `copyhand` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `copyhand`()
BEGIN
	DECLARE i INT DEFAULT 0;
	DECLARE randidx INT DEFAULT 0;
	select COUNT(*) INTO @recordcount from newuseraccounts where robot = 1;
	select COUNT(*) INTO @randMax from newuseraccounts where ADDDATE > '2016-12-29';
	while i < @recordcount do
		select FLOOR(RAND()* 10) into randidx;
		select headimgurl into @url from newuseraccounts where AddDate > '2016-12-29' LIMIT randidx,1;
		-- update newuseraccounts SET headimgurl = @url where robot = 1 LIMIT i,1;
		select Id into @idx from newuseraccounts where robot = 1 LIMIT i,1;
		update newuseraccounts SET headimgurl = @url where Id = @idx;
		set i = i + 1;
	end WHILE;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `createRecharge` */

/*!50003 DROP PROCEDURE IF EXISTS  `createRecharge` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `createRecharge`(userIdx INT(11),openidx VARCHAR(50),total_feex FLOAT(10),out_trade_nox VARCHAR(30),goodsIdx INT(2))
BEGIN
	SET @recordcount = (SELECT COUNT(*) FROM recharge WHERE out_trade_no = out_trade_nox);
	IF @recordcount <= 0 THEN
		INSERT INTO recharge(userId,Account,total_fee,out_trade_no,goodsid) VALUES(userIdx,openidx,total_feex,out_trade_nox,goodsIdx);
		SELECT 1 AS rcode;
	ELSE
		SELECT 0 AS rcode;
	END IF;
	
    END */$$
DELIMITER ;

/* Procedure structure for procedure `createUser` */

/*!50003 DROP PROCEDURE IF EXISTS  `createUser` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `createUser`(Accountx VARCHAR(50),Passwordx VARCHAR(32),nicknamex VARCHAR(20),scorex INT(20),px VARCHAR(20),phoneNox VARCHAR(13),emailx VARCHAR(20),sexx INT(1),cityx VARCHAR(20),countryx VARCHAR(10),provincex VARCHAR(20),headimgurlx VARCHAR(200),languagex VARCHAR(10))
BEGIN
	SET @recordcount = (SELECT COUNT(*) FROM newuseraccounts WHERE Account = Accountx);
	IF @recordcount <= 0 THEN
		INSERT INTO newuseraccounts(Account,PASSWORD,nickname,score,p,phoneNo,email,sex,city,province,country,headimgurl,LANGUAGE) VALUES(Accountx,Passwordx,nicknamex,scorex,px,phoneNox,emailx,sexx,cityx,provincex,countryx,headimgurlx,languagex);
		SELECT Id INTO @recordcount FROM newuseraccounts WHERE Account = Accountx;
		INSERT INTO userInfo_imp(userId,score,diamond,giftTicket) VALUES(@recordcount,scorex,0,0);
		INSERT INTO userInfo(userId,firstexchange) VALUES(@recordcount,0);
	END IF;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `dongshanzaiqi` */

/*!50003 DROP PROCEDURE IF EXISTS  `dongshanzaiqi` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `dongshanzaiqi`(userIdx int(11),dongshanzaiqi_flag bool)
BEGIN
	SET @scorex = -1;
	SET @dtimex = "";
	SET @k = 0;
	SET @maxcount = 2;
	
	if dongshanzaiqi_flag then
		SET @zaixian = (SELECT COUNT(*) FROM lineout WHERE userId = userIdx);
		IF @zaixian = 0 THEN
			/*满足东山再起的条件*/
			SELECT dtime,dcount INTO @dtimex,@dcountx FROM dongshanzaiqi WHERE userId = userIdx;
			IF @dtimex THEN
				/*已经有该用户数据,验证*/
				IF TO_DAYS(@dtimex)=TO_DAYS(NOW()) THEN
					IF @dcountx < @maxcount THEN
						UPDATE dongshanzaiqi SET dcount=dcount+1 WHERE userId = userIdx;
						SET @k = @dcountx + 1;
					ELSE
						/*次数已经使用完成*/
						SET @k = 0;
					END IF;
				ELSE
					/*已经不是同一天*/
					UPDATE dongshanzaiqi SET dtime=NOW(),dcount=1 WHERE userId = userIdx;
					SET @k = 1;
				END IF;
			ELSE
				/*先创建*/
				INSERT INTO dongshanzaiqi(userId,dcount) VALUES(userIdx,1);
				SET @k = 1;
			END IF;
		ELSE
			/*断线列表中*/
			SET @k = 0;
		END IF;
	else
		SET @k = 0;
	end if;
	
	SELECT @k AS 'k';
    END */$$
DELIMITER ;

/* Procedure structure for procedure `EditTicket` */

/*!50003 DROP PROCEDURE IF EXISTS  `EditTicket` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `EditTicket`(userIdx INT (11),ticketCountx INT (11),change_typex INT(2))
BEGIN
	DECLARE ticketCount INT DEFAULT -1;
	SELECT giftTicket INTO ticketCount FROM userinfo_imp WHERE userId = useridx;
	IF ticketCount = -1 THEN
		SELECT 0 AS rcode;
	ELSE
		UPDATE userinfo_imp SET giftTicket=giftTicket+ticketCountx WHERE userId = userIdx;
		INSERT INTO ticket_changelog(userid,score_before,score_change,score_current,change_type,isOnline) VALUES(userIdx,ticketCount,ticketCountx,ticketCount + ticketCountx,change_typex,0);
		SELECT 1 AS rcode;
	END IF;
