DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `recharge_first`(userIdx INT(11))
BEGIN
	select count(*) into @rcount from recharge_first where userId = userIdx;
	if @rcount then
		-- 有数据
		SELECT FIRST,anyFirst,daytime,goods1,goods2,goods3,goods4,goods5 into @first,@anyFirst,@dtimex,@goods1,@goods2,@goods3,@goods4,@goods5 FROM recharge_first WHERE userId = userIdx;
		-- 是否为当天
		IF TO_DAYS(@dtimex)=TO_DAYS(NOW()) THEN
			SELECT @first AS 'first', @anyFirst AS 'any',@goods1 AS 'goods1',@goods2 AS 'goods2',@goods3 AS 'goods3',@goods4 AS 'goods4',@goods5 AS 'goods5';
		else
		 	update recharge_first set anyFirst = 0,first = 0,goods1 = 0,goods2 = 0,goods3 = 0,goods4 = 0,goods5 = 0 where userId = userIdx;
			SELECT 0 AS 'first', 0 AS 'any',0 AS 'goods1',0 AS 'goods2',0 AS 'goods3',0 AS 'goods4',0 AS 'goods5';
		end if;
	else
		-- 没数据
		INSERT INTO recharge_first(userId) VALUES(userIdx);
		SELECT 0 AS 'first', 0 as 'any',0 AS 'goods1',0 AS 'goods2',0 AS 'goods3',0 AS 'goods4',0 AS 'goods5';
	end if;
    END */$$
DELIMITER ;

